import React from 'react';


import { useSelector, useDispatch } from 'react-redux'
import { userlist,adduser} from '../features/counter/counterSlice'


const Apilist = [
  {
  firstname: 'Olive',
  lastname: 'Yew',
  email: 'olive@test.com',
  carmodel: 'Honda Gt',
  phoneno: '9800000000',
  },
  {
    firstname: 'Maureen',
    lastname: 'Biologist',
    email: 'maureen@g.com',
    carmodel: 'Nissan',
    phoneno: '9800000001',
    }
]



function Userlist() {
    const list = useSelector((state) => state.counter.value);
    const dispatch = useDispatch()

   const DeleteHandler=()=>{
    Apilist.map((item) => {
console.log(item.firstname)
    });
   }


    return (

      <div>

<table class="table">
  <thead>
    <tr>
      <th scope="col">#</th>
      <th scope="col">First Name</th>
      <th scope="col">Last Name</th>
      <th scope="col">Email</th>
      <th scope="col">Car Model</th>
      <th scope="col">Phone Number</th>
      <th scope="col">Actions</th>
    </tr>
  </thead>    
  <tbody>


      {Apilist.map((item, key) => (
        <> <tr> 
    <th scope="row">{key+1}</th>
              <td>{item.firstname}</td>
              <td>{item.lastname}</td>
              <td>{item.email}</td>
              <td>{item.carmodel}</td>
              <td>{item.phoneno}</td>
              <td><a href='/' onClick={DeleteHandler}><svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" class="bi bi-trash" viewBox="0 0 16 16">
  <path d="M5.5 5.5A.5.5 0 0 1 6 6v6a.5.5 0 0 1-1 0V6a.5.5 0 0 1 .5-.5zm2.5 0a.5.5 0 0 1 .5.5v6a.5.5 0 0 1-1 0V6a.5.5 0 0 1 .5-.5zm3 .5a.5.5 0 0 0-1 0v6a.5.5 0 0 0 1 0V6z"/>
  <path fill-rule="evenodd" d="M14.5 3a1 1 0 0 1-1 1H13v9a2 2 0 0 1-2 2H5a2 2 0 0 1-2-2V4h-.5a1 1 0 0 1-1-1V2a1 1 0 0 1 1-1H6a1 1 0 0 1 1-1h2a1 1 0 0 1 1 1h3.5a1 1 0 0 1 1 1v1zM4.118 4 4 4.059V13a1 1 0 0 0 1 1h6a1 1 0 0 0 1-1V4.059L11.882 4H4.118zM2.5 3V2h11v1h-11z"/>
</svg></a></td>

              </tr>
        </> 

    ))}

  </tbody>
</table>

         {
            console.log('User info list',list?.userinfo)
         }
              <button onClick={() => dispatch(userlist())} > Get List </button> 
      </div>
    );

  }

  export default Userlist;
